import React from "react";
import PageStyles from "../styles/new-user-styles.module.scss";
import giftIcon from "../../images/priceGiftIcon.svg";
import CustomButton from "../../../../global-components/Button/Button";
import variables from "../../../styles-utils/variables.scss";

function PlanCard() {
  return (
    <div className={PageStyles.planCardWrapper}>
      <h2>title</h2>
      <span>
        <p>99 ₽</p>
        <p>за месяц</p>
      </span>
      <p>первый месяц за 99 ₽, далее — 199 ₽⁠/⁠месяц</p>

      <span>
        <img
          src={giftIcon}
          alt="toggle"
          style={{ transform: "translateY(25%)" }}
        />
        30 дней за 1 ₽
      </span>

      <CustomButton
          buttonName={"Выбрать"}
          backgroundColor="transparent"
          color={variables.$mainTextFontColor}
          borderColor={variables.$buttonBorderColor}
        />

    </div>
  );
}

export default PlanCard;
